import React from 'react';
import './App.css';

function Body({ items, handleCheckboxChange }) {
  return (
    <div className="body">
      <h2>List of Product</h2>
      <ul>
        {items.map((item) => (
          <li key={item.id}>
            <input
              type="checkbox"
              checked={item.checked}
              onChange={() => handleCheckboxChange(item.id)}
            />
            {item.name}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Body;
